{"cell_type":"code","execution_count":6,"id":"c82b4a33","metadata":{"execution":{"iopub.execute_input":"2023-08-06T20:37:58.726332Z","iopub.status.busy":"2023-08-06T20:37:58.72448Z","iopub.status.idle":"2023-08-06T20:37:58.744336Z","shell.execute_reply":"2023-08-06T20:37:58.742412Z"},"papermill":{"duration":0.034768,"end_time":"2023-08-06T20:37:58.746974","exception":false,"start_time":"2023-08-06T20:37:58.712206","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tBox-Ljung test\n","\n","data:  model$residuals\n","X-squared = 11.448, df = 20, p-value = 0.9338\n"]},"metadata":{},"output_type":"display_data"}],"source":["Box.test(model$residuals, lag=20, type = 'Ljung-Box')"]},{"cell_type":"markdown","id":"a76d42b6","metadata":{"papermill":{"duration":0.010311,"end_time":"2023-08-06T20:37:58.767772","exception":false,"start_time":"2023-08-06T20:37:58.757461","status":"completed"},"tags":[]},"source":["H0: The residuals are independently distributed.\n","\n","HA: The residuals are not independently distributed; they exhibit serial correlation.\n","\n","if the p-value of the test be greater than 0.05 this means that the residuals for our time series model are independent, which is often an assumption that needed to be made when creating a model. The correlation is not wanted here.\n","\n","An analysis of the Box-Ljung test results for the series timeseries:\n","\n","* The test statistic is 11.448.\n","* The degrees of freedom are 20.\n","* The p-value is 0.9338.\n","\n","The p-value is greater than 0.05, so we fail to reject the null hypothesis. This means that we cannot conclude that the residuals are autocorrelated. In other words, the residuals appear to be independent, which is a good sign for the model.\n","\n","Here is a brief interpretation of the results:\n","\n","* The test statistic is relatively small, which indicates that the residuals are not very autocorrelated.\n","* The p-value is relatively high, which also indicates that the residuals are not very autocorrelated.\n","* The fact that we fail to reject the null hypothesis suggests that the model is a good fit to the data, and that the residuals are independent.\n","\n","Overall, the results of the Box-Ljung test suggest that the residuals are independent. This is a good sign for the model, as it means that the model is not overfitting the data.\n","\n","# Residual plot"]},{"cell_type":"code","execution_count":7,"id":"11766935","metadata":{"execution":{"iopub.execute_input":"2023-08-06T20:37:58.793422Z","iopub.status.busy":"2023-08-06T20:37:58.791689Z","iopub.status.idle":"2023-08-06T20:37:58.901201Z","shell.execute_reply":"2023-08-06T20:37:58.899252Z"},"papermill":{"duration":0.124659,"end_time":"2023-08-06T20:37:58.903579","exception":false,"start_time":"2023-08-06T20:37:58.77892","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeWATZf7H8W+SNmnpfdLSFgqlQLnvoggCgoDK4eKtiK74Q0XxXFGERXc9YN0V\nFdD1PlBgPVBRWQ92WQUpiAegXJZbjt4XLT2T/P6YEgotbdommczk/forTaYzn5hoPz4zzzMG\nu90uAAAA0D6j2gEAAADgGhQ7AAAAnaDYAQAA6ATFDgAAQCcodgAAADpBsQMAANAJih0AAIBO\nUOwAAAB0gmIHAACgExQ7AAAAnaDYAQAA6ATFDgAAQCcodgAAADpBsQMAANAJih0AAIBOUOwA\nAAB0gmIHAACgExQ7AAAAnaDYAQAA6ATFDgAAQCcodgAAADpBsQMAANAJih0AAIBOUOwAAAB0\ngmIHAACgExQ7AAAAnaDYAQAA6ATFDgAAQCcodgAAADpBsQMAANAJih0AAIBOUOwAAAB0gmIH\nAACgExQ7AAAAnaDYAQAA6ATFDgAAQCcodgAAADpBsQMAANAJih0AAIBOUOwAL5W7baLhlCm7\n8utvsHZ8B8cGP5dVK09mb77M8eTBSqtnI/s427uP3tojOdbi52cOCEp/YMs5t6vOMpyb0WiO\niOlw0ZTbP9tZ5Na4zn9Vasp3O7acuC3XS1IBaBDFDsBpQ/v16dWrV69evaa+f0DtLBqz950/\n3PDYqzsP5VZZrdWVJ0+U1bRsP3Z7dVHe4f+u+ufkvqmv7ip0bUgAuuendgAAXmTXr78W1thE\nJLSgUu0sGvPVX9crD0z+UdfeNCVxcEwrd2itzrvv4vun//56q6MB8CEUO0BXYgeuyMurUh5H\nWEzqhvEpe06dDY/u88qyly938rfih77/yycjHT9aqyv2f7/6uqtnHaioEZETR974MG/plOhA\nl6cVviqATlHsAF0xmEKiolryi7mb1m8vq6q21/5YvDvjP/85GjVgWN9wswvjeYbdajOYPH2d\nic1e+8/OL7iN879l9A+JOvMDi514+wd/ennAX7cqP36SX+GmYtfirwoAb8Y1doCunPvac/t3\nK5+/dv